import Vue from 'vue'
Vue.component("PostLayout", () => import("/Users/luisguilherme/Documents/Desenvolvimento/vuepress/docs/.vuepress/components/PostLayout.vue"))
import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-c2f73826ab327",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/luisguilherme/Documents/Desenvolvimento/vuepress/docs/README.md").then(comp => {
        Vue.component("v-c2f73826ab327", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-ddb8e7337f724",
    path: "/test.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/luisguilherme/Documents/Desenvolvimento/vuepress/docs/test.md").then(comp => {
        Vue.component("v-ddb8e7337f724", comp.default)
        next()
      })
    }
  },
  {
    name: "v-5b9c2f844370c",
    path: "/welcome.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/luisguilherme/Documents/Desenvolvimento/vuepress/docs/welcome.md").then(comp => {
        Vue.component("v-5b9c2f844370c", comp.default)
        next()
      })
    }
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
